import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import classNames from "classnames";
import Button from "@material-ui/core/Button";
import AddIcon from "@material-ui/icons/Add";
import { BrowserRouter, Switch, Link, Route } from "react-router-dom";
import TitleBarMemberDet from "./titleBarMemberDetails";
import MemberPanelTabs from "./memberPanelTabs";
import Grid from "@material-ui/core/Grid";
import MouseIcon from "@material-ui/icons/Mouse";
import BuildIcon from "@material-ui/icons/Build";

const styles = theme => ({
  root: {
    paddingTop: theme.spacing(1),
    paddingBottom: theme.spacing(1),
    marginTop: theme.spacing(5),
    // marginLeft: theme.spacing(65),
    align: "center",
    width: "23%"
  },
  button: {
    margin: theme.spacing.unit,
    align: "center"
  },
  leftIcon: {
    marginRight: theme.spacing.unit
  },
  rightIcon: {
    marginLeft: theme.spacing.unit
  },
  iconSmall: {
    fontSize: 20
  },
  container: {
    display: "flex",
    flexWrap: "wrap"
  }
});

const navStyle = {
  color: "black",
  textDecoration: "none"
};

class clientActions extends React.Component {
  state = {
    open: true
  };

  handleClose = () => {
    this.setState({ open: false });
  };

  render() {
    const { classes } = this.props;

    return (
      <BrowserRouter>
        {/*
        <Switch>
          <Route
            path="/teammembers/newmember"
            exact
            render={() => (
              <div>
                <TitleBarMemberDet />
                <MemberPanelTabs />
              </div>
            )}
          />
        </Switch>
            */}
        <div>
          <Grid container direction="row" justify="center" alignItems="center">
            <Paper
              onClick={this.reloadPage}
              className={classes.root}
              elevation={7}
            >
              <Link style={navStyle} to="/clients/newclient">
                <Grid
                  container
                  direction="row-reverse"
                  justify="center"
                  alignItems="center"
                >
                  <Button
                    variant="contained"
                    className={classes.button}
                    //onClick={this.handleClickOpen}
                  >
                    <BuildIcon
                    /* className={classNames(
                        classes.leftIcon,
                        classes.iconSmall
                      )} */
                    />
                    Build
                  </Button>
                  <Button
                    variant="contained"
                    className={classes.button}
                    //onClick={this.handleClickOpen}
                  >
                    <MouseIcon
                    /* className={classNames(
                        classes.rightIcon,
                        classes.iconSmall
                      )} */
                    />
                    Selected
                  </Button>
                </Grid>
              </Link>
            </Paper>
          </Grid>
        </div>
      </BrowserRouter>
    );
  }
}

clientActions.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(clientActions);
